import React from 'react';
import { GoogleMap, Marker, LoadScript } from '@react-google-maps/api';

const BusinessMap = ({ business }) => {
  // Replace 'YOUR_API_KEY' with your actual Google Maps API key
  const apiKey = 'AIzaSyD254Fwgs-RkYHwu9J5yzkzfULuRloRPNE';

  const containerStyle = {
    width: '600px',
    height: '400px',
    marginBottom: '20px'
  };

  const center = {
    lat: business.latitude, // Replace with the actual latitude of the business
    lng: business.longitude, // Replace with the actual longitude of the business
  };

  return (
    <LoadScript googleMapsApiKey={apiKey}>
      <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={10}>
        <Marker position={center} title={business.name} />
      </GoogleMap>
    </LoadScript>
  );
};

export default BusinessMap;
